export function loadTitleScreen(scene){
    // Load Game Title
    // scene.load.svg("soulys_title", "https://project-pure-beyond.s3.amazonaws.com/Soulys/Start/Soulys_Title.svg");

    // Load Buttons
    scene.load.image("start_button", "https://project-pure-beyond.s3.amazonaws.com/Soulys/Start/StartButtons/start_button.png");
    scene.load.image("start_button_clicked", "https://project-pure-beyond.s3.amazonaws.com/Soulys/Start/StartButtons/start_button_clicked.png");
    scene.load.image("start_button_hover", "https://project-pure-beyond.s3.amazonaws.com/Soulys/Start/StartButtons/start_button_hover.png");
}
